const results = [];

for (const item of $input.all()) {
  try {
    const data = item.json.output;
    const parsed = JSON.parse(data);
    results.push({ json: parsed });
  } catch (error) {
    // Eƒüer parse edilemezse hata vermeden ge√ß
    results.push({ json: { error: 'Invalid JSON', original: item.json.output } });
  }
}

return results;

// Each item in input is processed separately
const item = $input.item;

// Copy the JSON content
const data = { ...item.json };

// Parse the enddate
const date = new Date(data.enddate);

// Add 10 minutes
date.setMinutes(date.getMinutes() + 10);

// Format back to YYYY-MM-DDTHH:mm:ss
const year = date.getFullYear();
const month = String(date.getMonth() + 1).padStart(2, '0');
const day = String(date.getDate()).padStart(2, '0');
const hours = String(date.getHours()).padStart(2, '0');
const minutes = String(date.getMinutes()).padStart(2, '0');
const seconds = String(date.getSeconds()).padStart(2, '0');

// Update the enddate
data.enddate = `${year}-${month}-${day}T${hours}:${minutes}:${seconds}`;

// ‚úÖ Return a single object for this item
return {
  json: data
};

// T√ºm takvim listesini al
const items = $input.all();

// Hangi takvimi istiyorsun
const targetName = "Calendar"; // ƒ∞stersen burayƒ± deƒüi≈ütir

// Flatten edilmi≈ü JSON'larƒ±n birle≈ümi≈ü halini istiyoruz
const allCalendars = [];
for (const item of items) {
  if (Array.isArray(item.json.value)) {
    allCalendars.push(...item.json.value);
  }
}

// ƒ∞stenen takvimi bul
const found = allCalendars.find(c => c.name === targetName);

if (!found) {
  return []; // bulunamazsa bo≈ü d√∂n
}

// Yeni bir JSON nesnesi olu≈ütur ve ID'yi calendar_id olarak ata
const resultJson = {
  calendar_id: found.id // 'id' alanƒ±nƒ± 'calendar_id' olarak yeniden adlandƒ±r
};

// n8n her zaman array bekler
return [
  {
    json: resultJson // Yeniden adlandƒ±rƒ±lmƒ±≈ü ID'yi i√ßeren nesneyi d√∂nd√ºr
  }
];

// Gelen verinin ilk √∂ƒüesini (listeyi) al ve dizi olarak d√∂nd√ºr.
// Dizi i√ßinde sadece tek bir liste (g√∂revler listesi) olacak.
return [
  {
    json: items[0]
  }
];

